import style from './Search.module.css'
import {IoSearchOutline} from 'react-icons/io5'

export const Search = () => {
	return (
		<div className={style.searchBlock}>
			<IoSearchOutline size='27px'/>
			<input className={style.search} type="text" placeholder="Search" />
		</div>
	)
}
